import React, { Component } from 'react';
import logo from './board-game-icon.svg';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      message: '',
    }
  }

  componentDidMount() {
    return fetch('/api/spiele')
      .then((response) => response.json())
      .then((responseJson) => {
        this.setState({
          message: responseJson.message
        });
        console.log('Hier! message ist:' + response + 'ENDE');
      })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" width="300" />
          <h1>GAMES</h1>
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <p>
            Nachricht von der API: <b>{this.state.message}</b>
          </p>
        </header>
      </div>
    );
  }
}

export default App;
